import React, { useState } from "react";
import ReactDOM from "react-dom/client";
import Button from "react-bootstrap/Button";
import Modal from "react-bootstrap/Modal";
import Card from "react-bootstrap/Card";
import "bootstrap/dist/css/bootstrap.css";

function Map() {
  const [show, setShow] = useState(false);

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);
  return (
    <div>
      <Modal show={show} onHide={handleClose} centered size="xl">
        <Modal.Body>
          <h1>Your Living Room</h1>
          <div
            style={{
              float: "left",
            }}
          >
            <Card
              style={{
                width: "18rem",
                height: "22rem",
                marginLeft: "5vw",
                marginTop: "5vh",
                marginRight: "5vw",
                marginBottom: "5vw",
              }}
            >
              <Card.Img variant="top" src="lightbulb.png" style={{}} />
              <Card.Body>
                <Card.Title>Phillips Hue Lightbulb</Card.Title>
                <Card.Text>
                  Status:{" "}
                  <span
                    style={{
                      color: "green",
                    }}
                  >
                    {" "}
                    ON{" "}
                  </span>
                </Card.Text>
                <Card.Text>
                  Status:{" "}
                  <span
                    style={{
                      color: "green",
                    }}
                  >
                    {" "}
                    ON{" "}
                  </span>
                </Card.Text>
                <Card.Text>
                  Status:{" "}
                  <span
                    style={{
                      color: "green",
                    }}
                  >
                    {" "}
                    ON{" "}
                  </span>
                </Card.Text>
                <Button variant="primary">Go somewhere</Button>
              </Card.Body>
            </Card>
            <Card style={{ width: "18rem" }}>
              <Card.Img variant="top" src="holder.js/100px180" />
              <Card.Body>
                <Card.Title>Card Title</Card.Title>
                <Card.Text>
                  Some quick example text to build on the card title and make up
                  the bulk of the card's content.
                </Card.Text>
                <Button variant="primary">Go somewhere</Button>
              </Card.Body>
            </Card>
            <Card style={{ width: "18rem" }}>
              <Card.Img variant="top" src="holder.js/100px180" />
              <Card.Body>
                <Card.Title>Card Title</Card.Title>
                <Card.Text>
                  Some quick example text to build on the card title and make up
                  the bulk of the card's content.
                </Card.Text>
                <Button variant="primary">Go somewhere</Button>
              </Card.Body>
            </Card>
          </div>
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleClose}>
            Close
          </Button>
          <Button variant="primary" onClick={handleClose}>
            Save Changes
          </Button>
        </Modal.Footer>
      </Modal>
      <img
        src="Map.png"
        style={{
          height: "70vh",
          width: "60vw",
        }}
      ></img>
      {/* Bedroom */}
      <div
        style={{
          position: "absolute",
          marginLeft: "320px",
          marginTop: "-560px",
          backgroundColor: "yellow",
          opacity: "0.1",
          height: "22vh",
          width: "12vw",
        }}
        onClick={handleShow}
      ></div>
      {/* Kitchen */}
      <div
        style={{
          position: "absolute",
          marginLeft: "800px",
          marginTop: "-400px",
          backgroundColor: "yellow",
          opacity: "0.1",
          height: "22vh",
          width: "12vw",
        }}
      ></div>
      {/* Study */}
      <div
        style={{
          position: "absolute",
          marginLeft: "400px",
          marginTop: "-200px",
          backgroundColor: "yellow",
          opacity: "0.1",
          height: "22vh",
          width: "12vw",
        }}
      ></div>
    </div>
  );
}

export default Map;
